import { configureStore } from '@reduxjs/toolkit';

import settingStyleAction from './settingStyle';
import { s,mediaSaveAction } from './mediaSave';

const store = configureStore({
  reducer: {
    themeStyle: settingStyleAction,
    mediaSave: mediaSaveAction,
  },
});

export default store;
